import React, { useEffect } from 'react';
import { useTranslation } from 'react-i18next';
import { motion } from 'framer-motion';
import './Skills.css';

const Skills = () => {
  const { t } = useTranslation();

  // Datos de habilidades técnicas
  const technicalSkills = [
    { name: 'Drupal', level: 90 },
    { name: 'Angular', level: 85 },
    { name: 'React', level: 80 },
    { name: 'JavaScript', level: 85 },
    { name: 'TypeScript', level: 75 },
    { name: 'PHP', level: 80 },
    { name: 'HTML/CSS/SASS', level: 90 },
    { name: 'C#/.NET', level: 70 },
    { name: 'SQL/MySQL', level: 75 },
    { name: 'Git', level: 85 },
    { name: 'RESTful APIs', level: 80 },
    { name: 'Firebase', level: 70 }
  ];

  // Datos de habilidades profesionales
  const professionalSkills = [
    { name: t('skills.comunicacion'), level: 85 },
    { name: t('skills.equipo'), level: 90 },
    { name: t('skills.creatividad'), level: 80 },
    { name: t('skills.dedicacion'), level: 95 },
    { name: 'Resolución de problemas', level: 85 },
    { name: 'Gestión del tiempo', level: 80 }
  ];

  // Forzar visibilidad después de la carga
  useEffect(() => {
    const timer = setTimeout(() => {
      const skillsColumns = document.querySelectorAll('.skills-column');
      skillsColumns.forEach(column => {
        if (column) column.style.opacity = '1';
      });
    }, 500);
    
    return () => clearTimeout(timer);
  }, []);

  // Animaciones
  const containerVariants = {
    hidden: { opacity: 0.5 },
    visible: {
      opacity: 1,
      transition: {
        staggerChildren: 0.1
      }
    }
  };

  const skillVariants = {
    hidden: { width: '0%', opacity: 0.5 },
    visible: skill => ({
      width: `${skill}%`,
      opacity: 1,
      transition: {
        duration: 0.8,
        ease: "easeInOut"
      }
    })
  };

  return (
    <section id="habilidades" className="skills-section">
      <div className="container">
        <motion.div
          className="section-title"
          initial={{ opacity: 0.5, y: -10 }}
          whileInView={{ opacity: 1, y: 0 }}
          viewport={{ once: true, amount: 0.2 }}
          transition={{ delay: 0.1, duration: 0.3 }}
          style={{ opacity: 1 }}
        >
          <h2>{t('skills.titulo')}</h2>
          <div className="underline"></div>
          <p className="section-subtitle">
            A lo largo de mi carrera he adquirido diversas habilidades técnicas y profesionales 
            que me permiten desarrollar soluciones web completas y eficientes.
          </p>
        </motion.div>

        <div className="skills-container">
          <motion.div 
            className="skills-column"
            variants={containerVariants}
            initial="hidden"
            whileInView="visible"
            viewport={{ once: true, amount: 0.2 }}
            style={{ opacity: 1 }}
          >
            <h3>{t('skills.tecnicas')}</h3>
            
            <div className="skills-list">
              {technicalSkills.map((skill, index) => (
                <div className="skill" key={index}>
                  <div className="skill-info">
                    <span className="skill-name">{skill.name}</span>
                    <span className="skill-percentage">{skill.level}%</span>
                  </div>
                  <div className="skill-bar">
                    <motion.div 
                      className="skill-progress"
                      custom={skill.level}
                      variants={skillVariants}
                      initial={{ width: '0%', opacity: 1 }}
                      whileInView={{ width: `${skill.level}%`, opacity: 1 }}
                      viewport={{ once: true }}
                      transition={{ duration: 0.8, delay: index * 0.1 }}
                    ></motion.div>
                  </div>
                </div>
              ))}
            </div>
          </motion.div>

          <motion.div 
            className="skills-column"
            variants={containerVariants}
            initial="hidden"
            whileInView="visible"
            viewport={{ once: true, amount: 0.2 }}
            style={{ opacity: 1 }}
          >
            <h3>{t('skills.profesionales')}</h3>
            
            <div className="skills-list">
              {professionalSkills.map((skill, index) => (
                <div className="skill" key={index}>
                  <div className="skill-info">
                    <span className="skill-name">{skill.name}</span>
                    <span className="skill-percentage">{skill.level}%</span>
                  </div>
                  <div className="skill-bar">
                    <motion.div 
                      className="skill-progress"
                      custom={skill.level}
                      variants={skillVariants}
                      initial={{ width: '0%', opacity: 1 }}
                      whileInView={{ width: `${skill.level}%`, opacity: 1 }}
                      viewport={{ once: true }}
                      transition={{ duration: 0.8, delay: index * 0.1 }}
                    ></motion.div>
                  </div>
                </div>
              ))}
            </div>

            <div className="skills-extra">
              <h4>Idiomas</h4>
              <ul>
                <li>Español - Nativo</li>
                <li>Inglés - Nivel B2</li>
              </ul>
            </div>
          </motion.div>
        </div>
      </div>
    </section>
  );
};

export default Skills;
